w_down=new Image();
w_down.src="/pic/w_show.gif";
w_up=new Image();
w_up.src="/pic/w_hide.gif";

function hideShow(elem,parent) {
  var child =  document.getElementById(elem);
  child.className = child.className == "collapsed" ? "expanded" : "collapsed";
  if (parent.className == "win_expandable") parent.src = child.className == "collapsed" ? w_down.src : w_up.src;
}
function RowSelect(row,sel){
  row.bgColor = sel==1 ? "#dddddd" : "#f5f5f5";
}
function show_help(topic){
  var frm = document.forms["results"];
  anewwin=window.open("", "addwin", "resizable=yes,scrollbars=yes,height=300,width=500,top=0,left=0");
  frm.action=topic;
  frm.target="addwin";
  frm.submit()
}
function select_all(){
  var frm = document.forms["results"];
  for (var i = 0; i < frm.elements.length; i++) {
    if (frm.elements[i].name.substring(0,3)=="tid"){
       frm.elements[i].checked=1;
       document.all.restab.rows["a" + frm.elements[i].name.substring(3, frm.elements[i].name.length)].bgColor = "#dddddd";}
  }
}
function deselect_all(){
  var frm = document.forms["results"];
  for (var i = 0; i < frm.elements.length; i++) {
    if (frm.elements[i].name.substring(0,3)=="tid"){
       frm.elements[i].checked=0;
       document.all.restab.rows["a" + frm.elements[i].name.substring(3, frm.elements[i].name.length)].bgColor = "#f5f5f5";}
  }
}
function itembox_add(){
  var frm = document.forms["results"];
  var issel=0;
  for (var i = 0; i < frm.elements.length; i++) {
    if (frm.elements[i].name.substring(0,3)=="tid"){
       if (frm.elements[i].checked) {issel=1; break}
    }
  }
  if (issel==0) {
    alert ("Не выделено ни одной статьи")}
  else {
    anewwin=window.open("", "dialog", "resizable=no,scrollbars=no,height=200,width=400,top=200,left=200");
    anewwin.resizeTo(400,200);
    frm.add_all.value=0;
    frm.action="itembox_item_add.asp";
    frm.target="dialog";
    frm.submit()
  }
}
function itembox_add_all(){
  var frm = document.forms["results"];
  anewwin=window.open("", "dialog", "resizable=no,scrollbars=no,height=200,width=400,top=200,left=200");
  anewwin.resizeTo(400,200);
  frm.add_all.value=1;
  frm.action="itembox_item_add.asp";
  frm.target="dialog";
  frm.submit()
}
function itembox_new(aid,anam){
  var frm = document.forms["results"];
  var el = document.createElement("OPTION");
  el.text=anam;
  el.value=aid;
  frm.itemboxid.options[frm.itemboxid.options.length]=el;
  frm.itemboxid[frm.itemboxid.length-1].selected=true;
}
function load_article(id){

  anewwin=window.open("full_text.asp?id="+id, "fulltext", "resizable=yes,scrollbars=yes,height=900,width=900,top=20,left=20");
  anewwin.resizeTo(900,900);

}
function html_article(id){

    anewwin=window.open("html_article.asp?id="+id, "fulltext", "resizable=yes,scrollbars=yes,top=0,left=0");

}
function order_item(id, pr){

  if (0-pr>=0){
    if (confirm("На Вашем счету сейчас 0 руб. \nПри открытии доступа к полному тексту данной публикации с Вашего счета будет списано " + eval(pr) + " руб.\nПодтверждаете приобретение публикации?")) {
    anewwin=window.open("", "fulltext", "resizable=yes,scrollbars=yes,top=0,left=0");
    document.forms["results"].action="buy_item.asp";
    document.forms["results"].payitemid.value=id;
    document.forms["results"].target="fulltext";
    document.forms["results"].submit()}}
  else {
    if (confirm("На Вашем счету сейчас 0 руб. \nДля получения доступа к полному тексту этой публикации Вам необходимо пополнить счет как минимум на " + eval(pr-0) + " руб.\nХотите пополнить счет прямо сейчас?")) {
    document.forms["results"].paysum.value=pr-0;
    document.forms["results"].payitemid.value=id;
    document.forms["results"].action="account_add.asp";
    document.forms["results"].target="";
    document.forms["results"].submit()}}

}

